import './signin.css';
import logo from '../../assets/logo.png'

function SignIn() {
  return (
    <div className='container'>
      <div>
        <div className='login'>
          <div className='logo'>
            <img src={logo} alt="Logo do sistema"/>
          </div>

          <form>
            <h1>Entrar</h1>
            <input type='text' placeholder='nome@etec.sp.gov.br' />
            <input type='password' placeholder='*******' />
          </form>
        </div>
      </div>
    </div>
  );
}

export default SignIn;
